import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect(() => {
    fetch('/server').then(
      res => res
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return (
    <div className="App">

    </div>
  );
}

export default App;
